  $templateCache.put('state/04term/term.html', '<ion-view id="term-detail"\n    cache-view="true"\n    hide-back-button="true"\n>\n  <ion-nav-buttons side="left">\n    <button class="button button-icon icon ion-android-arrow-back"\n      ng-click="goBack()"\n    >\n    </button>\n  </ion-nav-buttons>\n\n  <ion-nav-title>\n    <p class="zero">\n      이용약관\n    </p>\n  </ion-nav-title>\n\n\n  <ion-content class="pt2px">\n\n    <ion-refresher\n      on-refresh="TermDetail.refresh()"\n      ng-if="!TermDetail.Model.loading"\n    >\n    </ion-refresher>\n\n    <div class="w100p h95vh flex light-grey-bg absolute"\n      style="z-index: 2"\n      ng-if="TermDetail.Model.loading"\n    >\n      <ion-spinner class="spinner-40px mb132px" icon="ripple">\n      </ion-spinner>\n    </div>\n\n    <!-- row -->\n    <div class="pt5px pb20px pl5p pr5p">\n      <p class="zero pre f16px"> {{TermDetail.Model.post.content}}\n<b>Ohshop 서비스 이용 약관</b>\n\n제1장총칙 제 1 조 (목적)\n\n이 약관은 주식회사 오샵(이하 "회사"라 합니다)이 운영 • 제공하는 OhShop 및 관련 제반 서비스(이하 "서 비스")의 이용과 관련하여 회사와 회원과의 권리, 의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으 로 합니다.\n\n제 2 조 (정의)\n\n본 약관에서 사용하는 주요 용어는 다음과 같습니다.\n\n1 “OhShop" 이라 함은 회사가 전당포 거래 견적비교 서비스와 전당포에서 등록한 유질물 마켓 플랫폼을 이용고객에게 제공하기 위하여 컴퓨터, 스마트폰 등 정보통신설비를 이용하여 재화, 용역을 거래할 수 있 도록 설정한 가상의 영업장 또는 회사가 운영하는 웹사이트를 말하며, 아울러 ”OhShop"을 운영하는 사업 자의 의미로도 사용합니다.\n\n2 "회원"이라 함은 회사의 "서비스"에 접속하여 이 약관에 따라 "회사"와 이용계약을 체결하고 "회사"가 제 공하는 "서비스"를 이용하는 고객을 말합니다.\n\n3 "비회원“이라 함은 회원으로 가입하지 않고 회사가 제공하는 서비스를 이용하는 자를 말합니다.\n\n4 “상인회원” 이라 함은 전당포 운영자로 회사의 "서비스"에 접속하여 이 약관에 따라 "회사"와 이용계약 을 체결하고 "회사"가 제공하는 "서비스"를 이용하는 고객을 말합니다. 계약의 내용은 별도로 정하지 않는 한 “회원”과 동일하게 적용됩니다.\n\n5 “서비스”라 함은, 구현되는 단말기(PC, 태블릿, 휴대용 단말기 등의 각종 유무선 장치)와 상관없이 브 랜드명 "OhShop”을 사용하여 “회사”가 제공하는 제반 서비스를 말합니다.\n\n6 “이용고객” 이라 함은, 회사의 “서비스”에 접속하여 본 약관에 따라 회사가 제공하는 서비스를 받는 회 원과 비회원 및 상인회원을 말합니다.\n\n7 “아이디"라 함은 "회원"의 식별과 "서비스" 이용을 위하여 "회원"이 설정한 전자우편주소를 말합니다.\n\n8 "비밀번호"라 함은 "회원"이 부여받은 "아이디"와 일치되는 "회원"임을 확인하고 비밀보호를 위해 "회원" 자신이 정한 문자 또는 숫자의 조합을 의미합니다.\n\n9 “게시물” 이라 함은, “이용고객”이 “서비스”를 이용함에 있어 “서비스” 상에 게시한 부호ᆞ문자ᆞ음성 ᆞ음향ᆞ화상ᆞ동영상 등의 정보 형태의 글, 사진, 동영상 및 각종 파일과 링크 등을 의미합니다.\n\n10 "유료서비스"라 함은 "회사"가 유료로 제공하는 각종 온라인디지털콘텐츠(각종 정보콘텐츠, VOD, 기타 유료콘텐츠를 포함), 통계자료, 제반 서비스, 유질물 등록 서비스, 거래관련 서비스를 의미합니다.\n\n11 “유질물” 이라 함은 전당포에 맡긴 물건 중 상환기간이 지나고 상환의무를 다하지 않아 권리가 전당포 에 넘어간 담보물을 의미합니다.\n\n제 3 조 (약관의 게시, 효력 및 개정)\n\n1 회사는 본 약관의 내용을 이용고객이 쉽게 알 수 있도록 서비스 초기 화면에 게시합니다.\n\n2 회사는 콘텐츠산업 진흥법, 전자상거래 등에서의 소비자보호에 관한 법률, 약관의 규제에 관한 법률, 소비자기본법, 전자거래 기본법, 전자서명법, 정보통신망 이용촉진 및 정보보호 등에 관한 법률(정보통신망 법) 등 관련법을 위배하지 않는 범위에서 본 약관을 개정할 수 있습니다.\n\n3 회사가 약관을 개정할 경우에는 기존약관과 개정약관 및 개정약관의 적용일자와 개정사유를 명시하여 현행약관과 함께 그 적용일자 삼십(30)일 전부터 일정기간 서비스 내 공지하고, 로그인시 동의 창 등의 전 자적 수단을 통해 고지합니다.\n\n4 회사가 전 항에 따라 이용고객에게 통지하면서 공지 또는 공지∙고지일로부터 개정약관 시행일 7일 후 까지 거부의사를 표시하지 않으면 승인한 것으로 본다는 뜻을 명확하게 고지하였음에도, 이용고객이 명시 적으로 거부의 의사 표시를 하지 않은 경우에는 변경된 약관을 승인한 것으로 봅니다.\n\n5 이용고객이 개정약관에 동의하지 않을 경우 이용고객은 제26조 제1항의 규정에 따라 이용계약을 해지 할 수 있습니다.\n\n6 본 약관에서 정하지 아니한 사항과 이 약관의 해석에 관하여는 정부가 제정한 전자거래소비자보호지침 및 관계법령 또는 상관례에 따릅니다.\n\n제 2 장 계약의 체결 및 관리 제 4 조 (이용계약의 체결)\n\n1 이용계약은 회원이 되고자 하는 자(이하 "가입신청자")가 약관의 내용에 대하여 동의를 한 후 회원가입 신청을 하고 회사가 이러한 신청에 대하여 승낙함으로써 체결됩니다.\n\n2 회사는 가입신청자의 신청에 대하여 서비스 이용을 승낙함을 원칙으로 합니다. 다만, 회사는 다음 각 호에 해당하는 신청에 대하여는 승낙을 하지 않거나, 사후에 이용계약을 해지할 수 있습니다.\n\n1) 가입신청자가 이 약관에 의하여 이전에 회원자격을 상실한 적이 있는 경우\n\n2) 타인의 명의를 도용하여 이용신청을 하는 경우\n\n3) 허위의 정보를 기재하거나, 회사가 제시하는 내용을 기재하지 않은 경우\n\n4) 14세 미만 아동이 정보통신망 이용촉진 및 정보보호 등에 관한 법률에서 정한 "개인정보" 입력 시 법정 대리인(부모 등)의 동의를 얻지 아니한 경우\n\n5) 이용고객의 귀책사유로 인하여 승인이 불가능하거나 기타 규정한 제반 사항을 위반하며 신청하는 경우\n\n3 회원이 유료서비스를 이용하는 경우 이용대금을 납부한 후 서비스를 이용하는 것을 원칙으로 하며, 유료 서비스 이용계약 성립 시기는 구매완료를 신청절차 상에서 표시한 시점으로 합니다.\n\n4 회사는 만 20세 미만의 미성년회원이 유료서비스를 이용하고자 하는 경우에 부모 등 법정대리인의 동의 를 얻거나, 계약체결 후 추인을 얻지 않으면 미성년자 본인 또는 법정대리인이 그 계약을 취소할 수 있다 는 내용을 계약체결 전에 고지하는 조치를 취합니다.\n\n5 회사는 서비스관련설비의 여유가 없거나, 기술상 또는 업무상 문제가 있는 경우에는 승낙을 유보할 수 있습니다.\n\n6 이용계약의 성립 시기는 회사가 가입완료를 신청절차 상에서 표시한 시점으로 합니다\n\n7 회사는 회원에 대해 회사정책에 따라 등급별로 구분하여 이용시간, 이용횟수, 서비스 메뉴 등을 세분하 여 이용에 차등을 둘 수 있습니다.\n\n8 회사는 회원에 대하여 \'영화 및 비디오물의 진흥에 관한 법률\' 및 \'청소년보호법\' 등에 따른 등급 및 연 령 준수를 위해 이용제한이나 등급별 제한을 할 수 있습니다.\n\n9 제 2항의 1호에 따라 회원가입신청의 승낙을 하지 아니하거나 유보한 경우, 회사는 원칙적으로 이를 가입신청자에게 알리도록 합니다.\n\n제 5 조 (회원의 아이디 및 비밀번호의 관리에 대한 의무)\n\n1 회원의 아이디와 비밀번호에 관한 관리책임은 회원에게 있으며, 이를 제 3자가 이용하도록 하여서는 안 됩니다.\n\n2 회사는 회원의 아이디가 개인정보 유출 우려가 있거나, 반사회적이거나 회사 및 회사의 운영자로 오인 한 우려가 있는 경우, 해당 아이디의 이용을 제한할 수 있습니다.\n\n3 회원은 아이디및 비밀번호가 도용되거나 제 3자가 사용하고 있음을 인지한 경우에는 이를 즉시 회사에 통지하고 회사의 안내에 따라야 합니다.\n\n4 제 3항의 경우에 해당 회원이 회사에 그 사실을 통지하지 않거나, 통지한 경우에도 회사의 안내에 따 르지 않아 발생한 불이익에 대하여 회사는 책임지지 않습니다.\n\n제 6 조 (이용제한 등)\n\n1 회사는 회원이 이 약관의 의무를 위반하거나 서비스의 정상적인 운영을 방해한 경우, 경고, 일시정지, 영구이용정지 등으로 서비스 이용을 단계적으로 제한할 수 있습니다.\n\n2 회사는 전항에도 불구하고, \'주민등록법\'을 위반한 명의도용 및 결제도용, \'저작권법\' 및 \'컴퓨터 프로그 램 보호법\'을 위반한 불법프로그램의 제공 및 운영방해, ‘정보통신망법’을 위반한 불법통신 및 해킹, 악성\n\n프로그램의 배포, 접속권한 초과행위 등과 같이 관련법을 위반한 경우에는 즉시 영구이용정지를 할 수 있 습니다. 본 항에 따른 영구이용정지 시 서비스 이용을 통해 획득한 혜택 등도 모두 소멸되며, 회사는 이에 대해 별도로 보상하지 않습니다.\n\n3 회사는 회원이 계속해서 3개월 이상 로그인하지 않는 경우, 회원정보의 보호 및 운영의 효율성을 위해 이용을 제한할 수 있습니다.\n\n4 본 조에 따라 서비스 이용을 제한하거나 계약을 해지하는 경우에는 회원에게 통지합니다.\n\n5 회원은 본 조에 따른 이용제한 등에 대해 회사가 정한 절차에 따라 이의신청을 할 수 있습니다. 이 때 이의가 정당하다고 회사가 인정하는 경우 회사는 즉시 서비스의 이용을 재개합니다.\n\n제 7 조 (계약해제, 해지 등)\n\n1 회원은 언제든지 서비스초기화면의 고객센터 또는 내 정보 관리 메뉴 등을 통하여 이용계약 해지 신청 을 할 수 있으며, 회사는 관련법 등이 정하는 바에 따라 이를 즉시 처리하여야 합니다.\n\n2 회원이 계약을 해지할 경우, 관련법 및 개인정보취급방침에 따라 회사가 회원정보를 보유하는 경우를 제외하고는 해지 즉시 회원의 모든 데이터는 소멸됩니다.\n\n3 회원이 계약을 해지하는 경우, 회원이 작성한 게시물 중 메일, 블로그 등과 같이 본인 계정에 등록된 게시물 일체는 삭제됩니다. 다만, 타인에 의해 담기, 스크랩 등이 되어 재게시되거나, 공용게시판에 등록된 게시물 등은 삭제되지 않으니 사전에 삭제 후 탈퇴하시기 바랍니다.\n\n제 3 장 서비스 이용 제 8 조 (서비스의 이용)\n\n1 회사는 회원의 이용신청을 승낙한 때부터 즉시 서비스를 개시하며, 서비스 이용시간은 회사의 업무상 또는 기술상 불가능한 경우를 제외하고는 연중무휴 1일 24시간(00:00-24:00)으로 함을 원칙으로 합니다. 다만, 서비스 설비의 정기점검 등의 사유로 회사가 서비스를 특정범위로 분할하여 별도로 날짜와 시간을 정할 수 있습니다.\n\n2 회사는 컴퓨터 등 정보통신설비의 보수점검, 교체 및 고장, 통신두절 또는 운영상 상당한 이유가 있는 경우 서비스의 제공을 일시적으로 중단할 수 있습니다. 이 경우 회사는 회원에게 통지합니다. 다만, 회사 가 사전에 통지할 수 없는 부득이한 사유가 있는 경우 사후에 통지할 수 있습니다.\n\n3 회사는 서비스의 제공에 필요한 경우 정기점검을 실시할 수 있으며, 정기점검시간은 서비스제공화면 등 에 공지한 바에 따릅니다.\n\n4 회사는 모바일 단말기 전용 애플리케이션을 무료로 제공하며, 회원은 회사에서 제공하는 범위 내의 단 말기에 전용 애플리케이션을 다운로드 및 설치하여 서비스를 이용할 수 있습니다. 다만, 단말의 종류 및 통신사에 따라 애플리케이션의 구성과 기능에 차이가 있을 수 있습니다.\n\n5 회원이 공개한 게시물은 서비스를 통해 전체 회원, 관련 제반 서비스 및 제휴사에 공유될 수 있습니다. 제 9 조 (서비스의 내용)\n\n1 회사가 제공하는 서비스는 다음과 같습니다.\n\n1) 회원으로부터 또는 지정 위치로부터 특정범위 내 전당포에 대한 회원의 견적요청 신청 및 전당포 견적 비교 서비스\n\n2) 전당포 유질물(매물) 등록 서비스\n\n3) 상인회원 및 전당포 거래 등에 관한 정보제공\n\n4) 프리미엄 전당포 추천 등 광고 및 기타 관련 서비스\n\n5) 유료서비스 : 회사가 유료로 제공하는 각종 온라인디지털콘텐츠(각종 정보콘텐츠, VOD, 아이템 기타 유료콘텐츠를 포함), 제반 서비스 및 기타 물품등록서비스 또는 거래 관련 서비스를 의미합니다.\n\n6) 장소정보서비스: 회원은 위치정보를 이용하여 스스로 장소정보를 생성하거나, 회사가 제공한 장소정보 와 결합하여 또는 장소정보와의 결합 없이 독립적으로 견적요청 할 수 있으며, 등록 내용에 대한 공개 여 부를 사전에 설정할 수 있습니다.\n\n제 10 조 (서비스의 요금)\n\n1 회사가 제공하는 서비스는 별도의 약정이 없는 한 무료로 제공됩니다.\n\n2 회사는 유료서비스 이용요금을 회사와 계약한 전자지불업체에서 정한 방법에 의하거나 회사가 정한 청 구서에 합산하여 청구할 수 있습니다.\n\n3 유료서비스 이용을 통하여 결제된 대금에 대한 취소 및 환불은 회사의 결제 이용약관에 따릅니다.\n\n4 회원의 개인정보도용 및 결제사기로 인한 환불요청 또는 결제자의 개인정보 요구는 법률이 정한 경우 외에는 거절될 수 있습니다.\n\n5 무선 서비스 이용 시 발생하는 데이터 통신료는 별도이며, 가입한 각 이동통신사의 정책에 따릅니다. 6 MMS로 게시물을 등록할 경우 발생하는 요금은 이동통신사의 정책에 따릅니다.\n\n제 11 조 (서비스의 변경 및 중지)\n\n1 회사는 다음과 같은 상당한 이유가 있는 경우에 운영상, 기술상의 필요에 따라 제공하고 있는 전부 또 는 일부 서비스를 제한, 변경하거나 중지할 수 있습니다.\n\n1) 서비스용 설비의 보수, 점검 등 공사로인하여 부득이한 경우\n\n2) 정전, 제반 설비의 장애나 이용량 폭주 등으로 정상적인 서비스 이용에 지장이 발생하는 경우\n\n3) 서비스 제휴업체와의 계약 종료 등과 같이 회사의 제반 사정, 장애 또는 법률상의 이유로 서비스를 유 지 할 수 없는 경우\n\n4) 국가비상사태, 천재지변 등 불가항력적인 사유가 있는 경우\n\n5) 기타 중대한 사유로 인하여 회사가 서비스를 지속하는 것이 부적당하다고 인정되는 경우\n\n2 회사는 제1항에 의한 서비스 중단의 경우에 인터넷 등에 사전 공지하거나 이 약관에 정한 방법으로 회 원에게 통지합니다.\n\n3 서비스의 내용, 이용방법, 이용시간에 대하여 변경이 있는 경우에는 변경사유, 변경될 서비스의 내용 및 제공일자 등은 그 변경 전에 해당 서비스 초기화면에 게시하여야 합니다.\n\n4 회사는 무료로 제공되는 서비스의 일부 또는 전부를 회사의 정책 및 운영의 필요상 수정, 중단, 변경할 수 있으며, 이에 대하여 관련법에 특별한 규정이 없는 한 회원에게 별도의 보상을 하지 않습니다.\n\n제 12 조 (정보의 제공 및 광고의 게재)\n\n1 회사는 회원이 서비스 이용 중 필요하다고 인정되는 다양한 정보를 공지사항이나 전자우편 등의 방법 으로 회원에게 제공할 수 있습니다. 다만, 회원은 관련법에 따른 거래관련 정보 및 고객문의 등에 대한 답 변 등을 제외하고는 언제든지 전자우편에 대해서 수신 거절을 할 수 있습니다.\n\n2 회사는 서비스의 운영과 관련하여 서비스 화면, 홈페이지, 전자우편 등에 광고를 게재할 수 있습니다. 광고가 게재된 전자우편을 수신한 회원은 수신거절을 할 수 있습니다.\n\n3 이용고객(회원, 비회원, 상인회원 포함)은 회사가 제공하는 서비스와 관련하여 게시물 또는 기타 정보를 변경, 수정, 제한하는 등의 조치를 해서는 안됩니다.\n\n제 13 조 (게시물의 저작권)\n\n1 이용고객은 저작권 관련 규정을 준수하기 위해 충분한 주의를 기울여야만 합니다. 만약 이용고객이 등 록한 게시물이 제 3자의 저작권을 침해한 경우, 민형사상 모든 책임은 이용고객 당사자에게 있으며, 이와 관련해서 회사는 어떠한 책임도 지지 않습니다.\n\n2 이용고객는 OhShop을 이용함으로써 얻은 정보 중 회사에게 지적재산권이 귀속된 정보를 회사의 사전 승낙 없이 복제, 송신, 출판, 배포, 방송 기타 방법에 의하여 영리목적으로 이용하거나 제 3자에게 이용하 게 하여서는 안됩니다.\n\n3 회사는 회원이 작성한 각종 게시물을 판촉, 홍보 등의 목적으로 타 사이트에 복제, 배포, 전송, 전시할 수 있으며, 본질적인 내용에 변경을 가하지 않는 범위 내에서 수정, 편집될 수 있습니다.\n\n4 회사가 작성한 저작물에 대한 저작권 및 기타 지적 재산권은 회사에 귀속합니다.\n\n제 14 조 (게시물의 관리)\n\n1 회원의 게시물이 전자상거래법, 정보통신망법 및 저작권법등 관련법에 위반되는 내용을 포함하는 경우, 권리자는 관련법이 정한 절차에 따라 해당 게시물의 게시중단 및 삭제 등을 요청할 수 있으며, 회사는 관 련법에 따라 조치를 취하여야 합니다.\n\n2 회사는 전항에 따른 권리자의 요청이 없는 경우라도 권리침해가 인정될 만한 사유가 있거나 기타 회사\n\n정책 및 관련법에 위반되는 경우에는 관련법에 따라 해당 게시물에 대해 임시조치 등을 취할 수 있습니다\n\n제 15 조 (권리의 귀속)\n\n1 서비스에 대한 저작권 및 지적재산권은 회사에 귀속됩니다. 단, 회원의 게시물 및 제휴계약에 따라 제 공된 저작물 등은 제외합니다.\n\n2 회사는 서비스와 관련하여 회원에게 회사가 정한 이용조건에 따라 계정, 아이디, 콘텐츠 등을 이용할 수 있는 이용권만을 부여하며, 회원은 이에 대한 양도, 판매, 담보제공 등의 처분행위를 할 수 없습니다.\n\n제 16 조 (애플리케이션의 이용)\n\n1 회원은 모바일 단말기 제조사 및 이동통신사에서 제공하는 유무선 애플리케이션 마켓 혹은 서비스의 다운로드 페이지를 통해 애플리케이션을 설치하여 서비스를 이용할 수 있습니다.\n\n2 회원이 서비스의 일부 또는 이용규칙을 적용하는 데에 사용되는 보안 기술이나 소프트웨어를 회피 또 는 변경하려 시도를 하거나 부정 사용 및 타인이 그렇게 하는 것을 조장하는 행위 등은 금지되어 있으며, 만약 회원이 그와 같은 행위를 하는 경우 이에 대한 모든 책임은 회원 본인에게 있습니다.\n\n제 17 조 (대리행위의 부인)\n\n1 회사는 효율적인 서비스를 위한 시스템 운영 및 관리 책임만을 부담하며, 재화 또는 용역의 거래와 관 련하여 구매자 또는 판매자를 대리하지 아니하고, 회원 사이에 성립된 거래 및 회원이 제공하고 등록한 정 보에 대해서는 해당 회원이 그에 대한 모든 책임을 부담하여야 합니다.\n\n제 4 장 계약 당사자의 의무와 책임 제 18 조 (회원의 의무)\n\n1 회원은 다음 행위를 하여서는 안됩니다.\n\n1) 신청 또는 변경 시 허위내용의 등록\n\n2) 타인의 정보도용\n\n3) 회사에 게시된 정보의 변경\n\n4) 회사가 정한 정보 이외의 정보(컴퓨터 프로그램 등) 등의 송신 또는 게시\n\n5) 회사와 기타 제 3자의 저작권 등 지적재산권에 대한 침해\n\n6) 회사 및 기타 제 3자의 명예를 손상시키거나 업무를 방해하는 행위\n\n7) 외설 또는 폭력적인 메시지, 화상, 음성, 기타 공서양속에 반하는 정보를 회사에 공개 또는 게시하는 행위\n\n8) 회사의 동의 없이 영리를 목적으로 서비스를 사용하는 행위\n\n9) 기타 불법적이거나 부당한 행위\n\n10) 타인의 서비스 이용을 방해하는 경우\n\n11) 서비스를 이용하여 법령, 공공질서, 미풍양속 등에 반하는 행위를 한 경우\n\n2 회원은 관계법, 본 약관의 규정, 이용안내 및 서비스와 관련하여 공지한 주의사항, 회사가 통지하는 사 항 등을 준수하여야 하며, 기타 회사의 업무에 방해되는 행위를 하여서는 안 됩니다.\n\n3 상인회원은 회원의 의무를 준수해야하며 추가적으로 다음 행위를 하여서는 안됩니다.\n\n1) 견적서 내용에 허위사실을 기재하는 행위\n\n2) 전당포 거래에 관한 정보를 허위로 기재하는 행위\n\n3) 개인의 이익을 위해 허위 물건을 등록하는 행위\n\n4) 정당하지 않은 이유로 견적서 내용을 바꾸어 거래하는 행위\n\n4 상인 회원은 제 3항에 의한 행위를 하였을 경우, 회원과 회사측에 손해배상을 하여야하며 경우에 따라 발생하는 모든 법적 책임을 부담하여야 합니다.\n\n제 19 조 (회사의 의무)\n\n1 회사는 관련법과 이 약관이 금지하거나 미풍양속에 반하는 행위를 하지 않으며, 계속적이고 안정적으로 서비스를 제공하기 위하여 최선을 다하여 노력합니다.\n\n2 회사는 회원이 안전하게 서비스를 이용할 수 있도록 개인정보(신용정보 포함)보호를 위해 보안시스템을 갖추어야 하며 개인정보보호정책을 공시하고 준수합니다.\n\n3 회사는 서비스 이용과 관련하여 회원으로부터 제기된 의견이나 불만이 정당하다고 인정할 경우에는 이 를 처리하여야 합니다. 회원이 제기한 의견이나 불만사항에 대해서는 게시판을 활용하거나 전자우편 등을 통하여 회원에게 처리과정 및 결과를 전달합니다.\n\n4 회사는 다음의 사항을 해당 유료서비스의 이용초기화면이나 그 포장, FAQ 등에 회원이 알기 쉽게 표 시합니다.\n\n1) 유료서비스의 명칭 또는 제호\n\n2) 유료서비스의 내용, 이용방법, 이용료, 결제방법 기타 이용조건\n\n3) 이용가능 기기 및 이용에 필요한 최소한의 기술사양\n\n제 20 조 (개인정보보호 의무)\n\n1 회사는 정보통신망법 등 관계 법령이 정하는 바에 따라 회원의 개인정보를 보호하기 위해 노력합니다. 개인정보의 보호 및 사용에 대해서는 관련법 및 회사의 개인정보보호정책이 적용됩니다. 다만, 회사의 공 식 사이트 및 서비스 외의 링크된 사이트에서는 회사의 개인정보보호정책이 적용되지 않습니다.\n제 21 조 (회원에 대한 통지)\n\n1 회사가 회원에 대한 통지를 하는 경우 이 약관에 별도 규정이 없는 한 회원이 지정한 전자우편주소, 서 비스 내 전자메모 및 쪽지 등으로 할 수 있습니다.\n\n2 회사는 회원 전체에 대한 통지의 경우 7일 이상 회사의 게시판에 게시함으로써 제1항의 통지에 갈음할 수 있습니다.\n\n제 22 조 (부적절 행위)\n\n1 회사는 OhShop을 이용하는 선량한 이용고객를 보호하기 위한 목적으로 본 약관에서 명시한 사항들과 관련법령 및 상거래의 일반 원칙을 위반하는 부적절 행위를 행한 이용고객에게 서비스의 이용에 대한 제 재를 가할 수 있으며, 민형사상의 책임까지 물을 수 있습니다.\n\n2 회원이 다음의 사유에 해당하는 부적절 행위를 한 경우 회사는 사전 통보없이 해당 회원이 등록한 내 용을 삭제조치하거나, 회원 자격을 상실 시킬 수 있습니다.\n\n1) OhShop에 허위정보 등록\n\n2) 거래부적합 물품 등록\n\n3) 과대, 과장 광고 (스팸성 홍보글, 도배행위 등)\n\n4) 회사의 승인을 구하지 않은 상업성 광고 (개인사업자, 법인의 자사 홍보 등)\n\n5) 외설 또는 폭력적인 메시지, 화상, 음성, 기타 공서양속에 반하는 정보를 OhShop에 공개 또는 게시하 는 행위\n\n6) 회사와 기타 제 3자의 저작권 등 지적재산권에 대한 침해\n\n7) 회사 및 기타 제 3자의 명예를 손상시키거나 업무를 방해하는 행위\n\n8) 결재부정행위 (타인의 명의나 카드정보, 계좌정보 등을 도용하여 회사가 제공하는 구매 서비스를 이용 하는 행위는 금지됩니다.)\n\n9) 회사의 동의 없이 영리를 목적으로 서비스를 사용하는 행위\n\n10) 시스템의 오류를 회사에 알리지 않고 해당 오류를 이용해 이득을 취하는 행위\n\n11) 타인의 전화번호 또는 이메일을 도용하거나 허위로 이메일을 기재하여 이득을 취하는 행위\n\n12) 기타 불법적이거나 부당한 행위\n\n13) 회사가 정한 정보 이외의 정보(컴퓨터 프로그램 등) 등의 송신 또는 게시\n\n14) 기타 회사가 필요하다고 판단하는 경우\n\n제 5 장 이용고객 간 거래\n\n제 23 조 (거래 신청 및 계약의 성립)\n\n유질물의 판매 및 구매, 전당포 담보대출 등 거래신청에 대한 승낙의 표시가 상인회원과 회원 상호간 합의 하에 이루어진 경우, 거래 계약이 성립한 것으로 봅니다.\n\n제 24 조 (대금결제)\n\n1 이용고객은 유질물 구입 및 전당거래 시 상호간 합의하에 대금결제 방법을 정할 수 있습니다.\n\n2 이용고객 간 거래에 있어서 대금결제에 관한 사항은 이용고객 당사자들의 귀책으로 회사는 어떠한 책 임도 지지 않습니다.\n\n3 회사는 이용고객이 매매대금 및 대출 및 이자 상환금을 결제 할 수 있는 방법을 제공 할 수 있습니다. 다만, 대금 결제와 관련하여 회사와 이용고객의 분쟁 발생 시에는 기존의 제안가격, 약관을 바탕으로 해결 하며, 이용고객은 회사의 결정에 따라야 합니다. 회사는 객관적으로 분쟁을 조정할 의무가 있습니다.\n\n4 회사와 전자결제업체, 금융기관 간의 분쟁 시에는, 회사가 적극적으로 분쟁을 해결하며 이용고객은 분\n\n쟁이 해결될 때까지 기다리며, 회사의 결정에 따라야 합니다.\n\n제 25 조 (배송)\n\n1 이용고객은 상호간 합의하에 배송방법을 정할 수 있습니다. 이용고객 간 거래에 있어서 배송에 관한 사 항은 이용고객 당사자들의 귀책으로 회사는 어떠한 책임도 지지 않습니다.\n\n2 회사는 이용고객이 물건을 배송할 수 있는 방법을 제공할 수 있습니다. 다만, 배송과 관련하여 이용고 객은 최선의 방법으로 배송을 진행해야 하며, 배송에 문제가 발생 시 회사에 알려야 할 의무가 있으며, 손 해가 발생 했을 시에는 귀책사유를 판단하여 배상을 하여야 합니다.\n\n3 회사의 귀책사유에 해당된다면 회사가 해결 및 전액 배상하며, 이용고객의 귀책사유 일시에는 이용고객 이 해결 및 전액 배상을 해야 합니다.\n\n제 6 장 기타\n\n제 26 조 (책임제한)\n\n1 회사는 다음 사유로 서비스를 제공할 수 없는 경우 이로 인하여 회원에게 발생한 손해에 대해서는 책 임을 부담하지 않습니다.\n\n1) 천재지변 또는 이에 준하는 불가항력의 상태가 있는 경우\n\n2) 서비스 제공을 위하여 회사와 서비스 제휴계약을 체결한 제 3자의 고의적인 서비스 방해가 있는 경우 3) 회원의 귀책사유로 서비스 이용에 장애가 있는 경우\n\n4) 기타 회사의 고의∙과실이 없는 사유로 인한 경우\n\n2 회사는 이용고객이 서비스를 이용하여 얻은 정보, 자료, 사실의 신뢰도, 정확성 등에 대해서는 보증을 하지 않으며 이로 인해 발생한 이용고객의 손해에 대하여는 책임을 부담하지 않습니다.\n\n3 회사를 통해 접수를 하지 않아 전산에서 조회가 되지 않는 건에 대해 당사는 책임을 지지 않습니다.\n\n4 회사는 이용고객이 서비스를 이용하여 기대하는 수익을 얻지 못하거나 상실한 것에 대하여 책임을 지 지 않으며, 이용고객 상호간 및 이용고객과 제 3자 상호간에 서비스를 매개로 발생한 분쟁에 대해 개입할 의무가 없고, 이로 인한 손해를 배상할 책임도 부담하지 않습니다.\n\n5 전당계약은 이용고객과 상인회원 간의 계약이므로 전당 과정에서 발생한 분쟁에 대해 회사는 원칙적으 로 배상의 책임이 없으며, 다만 회사는 이용고객과 상인회원 간의 적극적 중재역할을 담당합니다.\n\n6 회사는 무료로 제공되는 서비스 이용과 관련하여 관련법에 특별한 규정이 없는 한 책임을 지지 않습니 다.\n\n7 회사는 이용고객 상호간 거래행위에서 발생되는 유질물의 결함, 사기행위 등 문제 및 손실에 대해서 일 체의 책임을 부담하지 않으며, 거래 당사자 간에 직접 해결해야 합니다.\n\n제 27 조 (분쟁의 조정 등)\n\n회사와 회원 간 제기된 소송은 대한민국법을 준거법으로 합니다.\n\n부칙\n1. 이 약관은 2015년 10월 30일부터 적용됩니다.\n\n\n</p>\n\n    </div>\n\n  </ion-content>\n</ion-view>\n');

